css:
.item-views {
  background: white !important;
}
[data-markdown-deluxe="true"] {
  margin: 0 auto;
}
[data-markdown-deluxe="true"]::shadow .markup.raw {
  opacity: 0.6;
}
[data-markdown-deluxe="true"]::shadow .gutter {
  display: none;
}
[data-markdown-deluxe="true"]::shadow .wrap-guide {
  opacity: 0;
}
[data-markdown-deluxe="true"]::shadow .editor--private .vertical-scrollbar {
  opacity: 0;
  transition: opacity .2s .1s;
}
[data-markdown-deluxe="true"]::shadow .editor--private:hover .vertical-scrollbar {
  opacity: 1;
}
